import React from 'react'
import styles from '../frontend/cv/styles/main.scss'
export const Main = () => {
    return (
        <div className={styles.main}>
            <div className={styles.HeaderContainer}>
                <div className={styles.HeadItem}>

                </div>
            </div>
        </div>
    )
}
export default Main
